import './Header.css';

function Header() {
    return (
        <div className="header">
            <div className="header_first">
                <h4 className="header_link">Menu</h4>
                <h4 className="header_link">Rewards</h4>
                <h4 className="header_link">Gift Cards</h4>
            </div>
        </div>
    );
}

export default Header
